annotation:
now if: 
a) Bh7?? blocks the only escape square from black's king and I have Bb7 to win a quality as black's rook can't move away from the 8th rank;
b) and if Bc2?? I have Qxc8+ followed by Be4 to win a rook and a bishop; 
c) and if Bb1?! I have Bb7 threatening to win a quality;
so I expect to see Bd3 the only playable move by black...
